import React from 'react';

const PhotoGallery = () => {
  const images = [
    'image1.jpg',
    'image2.jpg',
    'image3.jpg',
    // Add more image URLs here
  ];

  return (
    <div className="photo-gallery">
      {images.map((image, index) => (
        <img key={index} src={image} alt={`Image ${index}`} className="photo" />
      ))}
    </div>
  );
};

export default PhotoGallery;
